import { STEPPER_FORM_DATA_KEY } from "../constants";

export default () => {
  const rawFormData = localStorage.getItem(STEPPER_FORM_DATA_KEY);

  if (!rawFormData) {
    return [];
  }

  return JSON.parse(rawFormData);
};
